import React from 'react';
import { Pub } from './assets/HelperComponents';

function Publications() {
  return (
    <div className="">
      <div className="pub-wrapper">
        <h5>Conference and Journal Papers</h5>
        <Pub
          title="Investigating How Users in the United States Encounter and Deal With Misinformation on WhatsApp During COVID-19"
          authors={["Oishee Chakrabarti*", <span><u>K. J. Kevin Feng</u>*</span>, "Kejing Li*", "Kevin Song*", "Marshini Chetty"]}
          venue="In submission"
        />
      </div>

      <div className="pub-wrapper">
        <h5>Non-refereed Papers</h5>
          <Pub
            title="Lowering the Barrier for Web Advertisement Research at Scale"
            authors={[<u>K. J. Kevin Feng</u>, "Arunesh Mathur", "Arvind Narayanan"]}
            venue="Princeton CS Senior Thesis"
            paper={ require("./assets/files/pton-thesis.pdf").default }
            slides={ require("./assets/files/pton-thesis-slides.pdf").default }
            video="https://mediacentral.princeton.edu/media/Lowering+the+Barrier+for+Web+Advertisement+Research+at+Scale%2C+Kai+Ji+%28Kevin%29+Feng%2C+UG+%2721+%282310672%29/1_zbbnuep9/210652663"
            bibtex="@inproceedings{hohman2020understanding,
  title={Understanding and Visualizing Data Iteration in Machine Learning},
  author={Hohman, Fred and Wongsuphasawat, Kanit and Kery, Mary Beth and Patel, Kayur},
  booktitle={Proceedings of the SIGCHI Conference on Human Factors in Computing Systems},
  year={2020},
  organization={ACM},
  doi={10.1145/3313831.3376177}
}"
          />
          <Pub
            title="Saving the Sonorine: Photo-Based Audio Recovery With Photometric Stereo"
            authors={[<u>K. J. Kevin Feng</u>, "Adam Finkelstein"]}
            venue="Princeton CS Junior Research Project"
          />
      </div>

      {/*<img src={ require('./assets/img/construction.gif').default } style={{maxWidth: 500}}/>*/}

    </div>
  );
}

export default Publications;
